E_D("replace into `phome_ecms_infotmp_game` values('1836','17','http://www.61baobao.com/tingerge/2349/','0','2012-06-29 02:10:27','红星歌','2012-06-29 02:10:27','4usky','2','1340907027','','http://www.61baobao.com/common/flash/2009/pic/2349.jpg','','0','','http://s.61baobao.com/zt/qinbao/hongxing.swf','667','479','词曲/傅庚辰<br /><br />    红星闪闪放光彩，红星灿灿暖胸怀，红星是咱工农的心，党的光辉照万代。红星是咱工农的心，党的光辉照万代。长夜里，红星闪闪驱黑暗；寒冬里，红星闪闪迎春来；斗争中，红星闪闪指方向；征途上，红星闪闪把路开。红星闪闪放光彩，红星灿灿暖胸怀，跟着毛主席跟着党，闪闪的红星传万代，跟着毛主席跟着党，闪闪的红星传万代。<br /><br />    1974年电影《闪闪的红星》热映，一曲《红星闪闪》打动了千千万万儿童的心。他们穿着红军服，抗着红缨枪，雄壮有力地走在大路上，胸中溢满了自豪和勇敢。歌曲唱出了小红军战士对“红星”的深情和对革命的无限忠诚。集中代表了红军后代跟着党永远干革命的坚定信念，以及对象征党的“红星”的热情赞颂。','http://www.61baobao.com/common/flash/2009/dpic/2349.jpg','2349','VEROd01Fd3pSbkJpYlVwb1luazViMkl5Tlc1bFIyeDFXbmsxZW1ReVdUMD0=','http://s.61baobao.com/zt/qinbao/hongxing.swf','http://www.61baobao.com/common/flash/2009/dpic/2349.jpg','http://www.61baobao.com/common/flash/2009/pic/2349.jpg','三个月以上','0','0','','0');");
