E_D("replace into `phome_ecms_infotmp_game` values('1909','17','http://www.61baobao.com/tingerge/2268/','0','2012-06-29 02:12:56','猪都笑了儿童版','2012-06-29 02:12:56','4usky','2','1340907176','','http://www.61baobao.com/common/flash/2009/pic/2268.jpg','','0','','http://s.61baobao.com/common/flash/2009/2268.swf','667','479','小青蛙说它嘴巴大， 河马叔叔就笑了；<br />河马叔叔说它个子大， 大象爷爷就笑了；<br />大象爷爷说它啥都不怕， 老鼠弟弟就笑了；（咬你耳朵）<br />老鼠说它爱大米， 母鸡阿姨就笑了。（咯咯咯咯）<br /><br /><br />母鸡阿姨说它会唱歌， 鹦鹉哥哥就笑了；<br />鹦鹉哥哥说它眼睛大， 小燕子姐姐就笑了；(我是还珠格格)<br />小燕子说它最可爱， 小狗狗就笑了；<br />小狗狗说它最聪明， 大猩猩就笑了。<br /><br />啦。。。。。。。。 米奇老鼠唐老鸭，<br />大猩猩说它是人模样， 胖呼呼的猪都笑了。<br /><br /><br />天鹅姑姑说它最美丽， 孔雀姐姐就笑了；<br />孔雀姐姐说它很骄傲， 小白兔就笑了；<br />小白兔说它跑得快， 老乌龟就笑了（龟兔赛跑）<br />老乌龟说它是国宝啊， 大熊猫就笑了。<br /><br />啦。。。。。。。。 团团又圆圆，<br />大熊猫说它去台湾啊， 全国人民都笑了。<br /><br />','http://www.61baobao.com/common/flash/2009/dpic/2268.jpg','2268','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRTFUSHBKZVU1cVozVmpNMlJ0','http://s.61baobao.com/common/flash/2009/2268.swf','http://www.61baobao.com/common/flash/2009/dpic/2268.jpg','http://www.61baobao.com/common/flash/2009/pic/2268.jpg','三个月以上','0','0','','0');");
