E_D("replace into `phome_ecms_infotmp_game` values('1972','17','http://www.61baobao.com/tingerge/1920/','0','2012-06-29 02:14:26','童年','2012-06-29 02:14:26','4usky','2','1340907266','','http://www.61baobao.com/common/flash/d/pic/1920.jpg','','0','','http://s.61baobao.com/zt/qinbao/2012/tongnian.swf','667','479','池塘边的榕树上,知了在声声叫着夏天，<br />草丛边的秋千上,只有蝴蝶停在上面，<br />黑板上老师的粉笔还在拼命叽叽喳喳写个不停，<br />等待着下课等待着放学等待游戏的童年，<br />福利社里面什么都有就是口袋里没有半毛钱。<br />诸葛四郎和魔鬼党到底谁抢到那支宝剑,<br />隔壁班的那个女孩怎么还没经过我的窗前,<br />嘴里的历史手里的漫画心里初恋的童年,<br />总是要等到睡觉前才知道功课只做了一点点,<br />总是要等到考试后才知道该念的书都没有念,<br />一寸光阴一寸金老师说过寸金难买寸光阴,<br />一天又一天一年又一年迷迷糊糊的童年,没有人知道为什么太阳总下到山的那一边,<br />没有人能够告诉我山里面有没有住着神仙,多少平日记忆总是一个人面对着天空发呆,<br />就这么好奇就这么幻想这么孤单的童年,阳光下蜻蜓飞过来一片片绿油油的稻田,<br />水彩蜡笔和万花筒画不出天边那一条彩虹,什么时候才能像高年级的同学有张成熟与长大的脸,<br />盼望着假期盼望着明天盼望长大的童年,一天又一天一年又一年盼望长大的童年 .','http://www.61baobao.com/common/flash/d/dpic/1920.jpg','1920','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhsTU0xSjJZbTFrZFdGWFJuVk1iazR6V21jOVBRPT0=','http://s.61baobao.com/zt/qinbao/2012/tongnian.swf','http://www.61baobao.com/common/flash/d/dpic/1920.jpg','http://www.61baobao.com/common/flash/d/pic/1920.jpg','三个月以上','0','0','','0');");
