E_D("replace into `phome_ecms_infotmp_game` values('2015','17','http://www.61baobao.com/tingerge/1825/','0','2012-06-29 02:15:33','天黑黑','2012-06-29 02:15:33','4usky','2','1340907333','','http://www.61baobao.com/common/flash/d/pic/1825.jpg','','0','','http://s.61baobao.com/common/flash/d/1825.swf','667','479','我的小时候 ，吵闹任性时侯 ，我的外婆 ，<br />总会唱歌哄我 ，夏天的午后 ，<br />老老的歌安慰我 ，那首歌好象这样唱的 。<br />天黑黑欲落雨 ,天黑黑黑黑 ,离开小时候 ,<br />有了自己的生活 ,新鲜的歌 ,新鲜的念头 ,<br />任性和冲动 ,无法控制的时候 ,我忘记 ,<br />还有这样的歌 ,天黑黑欲落雨 ,天黑黑黑黑 ,<br />我爱上让我奋不顾身的一个人 ,<br />我以为这就是我所追求的世界 ,<br />然而横冲直撞被误解被骗 ,<br />是否成人的世界背后总有残缺 ,我走在每天必须面对的分岔路 ,我怀念过去单纯美好的小幸福 ,<br />爱总是让人哭 ,让人觉得不满足 ,天空很大却看不清楚 ,好孤独 ,天黑的时候 ,我又想起那首歌 ,突然期待 ,<br />下起安静的雨 ,原来外婆的道理早就唱给我听 ,下起雨也要勇敢前进…. ,我相信一切都会平息 ,<br />我现在好想回家去 ,天黑黑欲落雨 ,天黑黑黑黑.','http://www.61baobao.com/common/flash/d/dpic/1825.jpg','1825','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVrVTBUV3BWZFdNelpHMD0=','http://s.61baobao.com/common/flash/d/1825.swf','http://www.61baobao.com/common/flash/d/dpic/1825.jpg','http://www.61baobao.com/common/flash/d/pic/1825.jpg','三个月以上','0','0','','0');");
