E_D("replace into `phome_ecms_infotmp_game` values('2075','17','http://www.61baobao.com/tingerge/1666/','0','2012-06-29 02:17:03','哆来咪','2012-06-29 02:17:03','4usky','2','1340907423','','http://www.61baobao.com/zt/qinbao/2012/pic/duolaimi.jpg','','0','','http://s.61baobao.com/zt/qinbao/2012/duolaimi.swf','667','479','《哆来咪》歌词：<br />来吧 让我们一起来学习<br />最好就是从头起<br />要念书 先得学会<br />A B C<br />要唱歌 先得学会<br />duo lai mi<br />duo lai mi<br />duo lai mi<br />是最先碰到的三个音级<br />duo lai mi<br />duo lai mi<br />duo lai mi fa suo la xi<br /><br />哦 让我想想<br />怎么才能好记一点<br />嗯 有了<br />duo（多）好朋友多呀多<br />lai（来）快来呀来唱歌<br />mi（眯）她脸上笑眯眯<br />fa（发）要发出光和热<br />suo（锁）能拴住门和窗<br />la（拉）是用力往回拖<br />xi（西）那太阳往西落<br />回头我们又唱duo（多）<br />oh oh oh<br /><br />dduo（多）好朋友多呀多<br />lai（来）快来呀来唱歌<br />mi（眯）她脸上笑眯眯<br />fa（发）要发出光和热<br />suo（锁）能拴住门和窗<br />la（拉）是用力往回拖<br />xi（西）那太阳往西落<br />回头我们又唱duo（多）<br />oh oh oh<br />duo lai mi fa suo la xi<br />duo suo duo','http://www.61baobao.com/zt/qinbao/2012/dpic/duolaimi.jpg','1666','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhsTU1sSXhZako0YUdGWE1YQk1iazR6V21jOVBRPT0=','http://s.61baobao.com/zt/qinbao/2012/duolaimi.swf','http://www.61baobao.com/zt/qinbao/2012/dpic/duolaimi.jpg','http://www.61baobao.com/zt/qinbao/2012/pic/duolaimi.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('2076','17','http://www.61baobao.com/tingerge/1665/','0','2012-06-29 02:17:03','点点的童年故事','2012-06-29 02:17:03','4usky','2','1340907423','','http://www.61baobao.com/common/flash/2008/pic/1665.gif','','0','','http://s.61baobao.com/common/flash/2008/diandiantongniangushi.swf','667','479','池塘边的榕树上 知了在声声地叫着夏天 <br />操场边的秋千上 只有蝴蝶儿停在上面 <br />黑板上老师的粉笔 还在拼命唧唧喳喳写个不停 <br />等待着下课 等待着放学 等待 游戏的童年 <br /><br />福利社里面什么都有 就是口袋里没有半毛钱 <br />诸葛四郎和魔鬼党 到底谁抢到那支宝剑 <br />隔壁班的那个男孩 怎么还没经过我的窗前 <br />嘴里的零食 手里的漫画 心里初恋的童年 <br /><br />总是要等到睡觉前 才知道功课只做了一点点 <br />总是 要等到考试以后 才知道该念的书还没有念 <br />一寸光阴一寸金 老师说过寸金难买寸 光阴 <br />一天又一天 一年又一年 迷迷糊糊的童年 <br /><br />没有人知道为什么 太阳总下到山的 那一边 <br />没有人能够告诉我 山里面有没有住着神仙 <br />多少的日子里总是 一个人面对着天空发呆 <br />就这么好奇 就这么幻想 这么孤单的童年 <br /><br />阳光下蜻蜓飞过来 一片片绿油油的稻田 <br />水彩蜡笔和万花筒 画不出一边那一道彩 <br />什么时候才能 象高年级的同学有张成熟与长大的脸 <br />盼望着假期盼望着明天盼望着长大的童年 <br />一天又一天 一年又一年 盼望长大的童年','http://www.61baobao.com/common/flash/2008/dpic/1665.gif','1665','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRTBUREpTY0ZsWE5XdGhWMFoxWkVjNWRWb3lOWEJaVnpWdVpGaE9iMkZUTlhwa01sazk=','http://s.61baobao.com/common/flash/2008/diandiantongniangushi.swf','http://www.61baobao.com/common/flash/2008/dpic/1665.gif','http://www.61baobao.com/common/flash/2008/pic/1665.gif','三个月以上','0','0','','0');");
