E_D("replace into `phome_ecms_infotmp_game` values('2080','17','http://www.61baobao.com/tingerge/1645/','0','2012-06-29 02:17:09','妈妈教我一支歌','2012-06-29 02:17:09','4usky','2','1340907429','','http://www.61baobao.com/common/flash/2008/pic/1645.jpg','','0','','http://s.61baobao.com/common/flash/2008/mamajiaowoyizhige.swf','667','479','妈妈教我一支歌<br />没有共产党就没有新中国<br />这支歌从妈妈心头飞出<br />这支歌伴随她走遍祖国山河<br />啊...<br />这支歌伴随她走遍祖国山河<br />我唱妈妈教的歌<br />没有共产党就没有新中国<br />这支歌从我的心上飞起<br />这支歌鼓舞我建设新生活<br />我教儿女一支歌<br />没有共产党就没有新中国<br />这支歌飞进幼小心田<br />这支歌世世代代永不落<br />啊...<br />这支歌世世代代永不落<br />这支歌世世代代永不落<br />','http://www.61baobao.com/common/flash/2008/dpic/1645.jpg','1645','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRTBUREl4YUdKWFJuRmhWMFoyWkRJNU5XRlljRzloVjJSc1RHNU9NMXBuUFQwPQ==','http://s.61baobao.com/common/flash/2008/mamajiaowoyizhige.swf','http://www.61baobao.com/common/flash/2008/dpic/1645.jpg','http://www.61baobao.com/common/flash/2008/pic/1645.jpg','三个月以上','0','0','','0');");
