E_D("replace into `phome_ecms_infotmp_game` values('2082','17','http://www.61baobao.com/tingerge/1643/','0','2012-06-29 02:17:15','妈妈的童谣','2012-06-29 02:17:15','4usky','2','1340907435','','http://www.61baobao.com/common/flash/2008/pic/1643.jpg','','0','','http://s.61baobao.com/common/flash/2008/mamadetongyao.swf','667','479','那时我还很小，躺在妈妈怀抱，<br /><br />伴着窗外明月，妈妈唱起童谣<br /><br /> <br /><br />我看见月亮在笑,妈妈也在笑, <br /><br />妈妈的童谣多么美妙 在我梦中飘呀飘<br /><br /> <br /><br />如今我已长高，难忘妈妈怀抱，<br /><br />伴着窗外明月，想起妈妈的童谣。<br /><br /> <br /><br />无论在天涯海角，无论我再长多高，<br /><br />忘不了那温暖的怀抱，忘不了那美丽的童谣<br />','http://www.61baobao.com/common/flash/2008/dpic/1643.jpg','1643','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRTBUREl4YUdKWFJtdGFXRkoyWW0xa05WbFhPSFZqTTJSdA==','http://s.61baobao.com/common/flash/2008/mamadetongyao.swf','http://www.61baobao.com/common/flash/2008/dpic/1643.jpg','http://www.61baobao.com/common/flash/2008/pic/1643.jpg','三个月以上','0','0','','0');");
E_D("replace into `phome_ecms_infotmp_game` values('2083','17','http://www.61baobao.com/tingerge/1642/','0','2012-06-29 02:17:15','妈妈的吻','2012-06-29 02:17:15','4usky','2','1340907435','','http://www.61baobao.com/common/flash/2008/pic/1642.jpg','','0','','http://s.61baobao.com/common/flash/2008/mamadewen.swf','667','479','在那遥远的小山村小呀小山村<br />我那亲爱的妈妈已白发鬓鬓<br />过去的时光难忘怀难忘怀<br />妈妈曾给我多少吻多少吻<br />吻干我那脸上的泪花<br />温暖我那幼小的心<br />妈妈的吻甜蜜的吻<br />叫我思念到如今<br /><br />遥望家乡的小山村小呀小山村<br />我那可爱的小燕子可回了家门<br />女儿有个小小心愿小小心愿<br />再还妈妈一个吻一个吻<br />吻干她那帜热的泪珠<br />安抚她那孤独的心<br />女儿的吻纯洁的吻<br />愿妈妈得欢欣','http://www.61baobao.com/common/flash/2008/dpic/1642.jpg','1642','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRTBUREl4YUdKWFJtdGFXR1JzWW1rMWVtUXlXVDA9','http://s.61baobao.com/common/flash/2008/mamadewen.swf','http://www.61baobao.com/common/flash/2008/dpic/1642.jpg','http://www.61baobao.com/common/flash/2008/pic/1642.jpg','三个月以上','0','0','','0');");
